export const homeObjOne = {
  id: 'about',
  lightBg: false,
  lightText: true,
  lightTextDesc: true,
  topLine: 'Premium Trucking',
  headline: 'Transportion Services',
  description:
    'We understand that ensuring your shipments arrive to their destination, not only safe and intact but in a timely manner is vital to the success of your business.',
  buttonLabel: 'Get Started',
  imgStart: false,
  img: require('../../images/trucksOnHighway.jpg'),
  alt: 'TrucksOnHighway',
  dark: true,
  primary: true,
  darkText: false
};

export const homeObjTwo = {
  id: 'discover',
  lightBg: true,
  lightText: false,
  lightTextDesc: false,
  topLine: 'Premium fleet',
  headline: 'Join our network!',
  description:
    'We provide the transportation solutions you need to support your growing business.',
  buttonLabel: 'Learn More',
  imgStart: true,
  img: require('../../images/semiTrucks.jpg'),
  alt: 'SemiTrucks',
  dark: false,
  primary: false,
  darkText: true
};

export const homeObjThree = {
  id: 'signup',
  lightBg: true,
  lightText: false,
  lightTextDesc: false,
  topLine: 'Work with our prestigious team',
  headline: 'Setting up an initial consultation is extremely easy',
  description:
    "Get everything set up and ready in under 10 minutes. All you need to do is add your information and you're ready to go.",
  buttonLabel: 'Start Now',
  imgStart: false,
  img: require('../../images/truckConsultation.jpeg'),
  alt: 'AccountCreate',
  dark: false,
  primary: false,
  darkText: true
};

